import React from 'react'
import {View,TouchableOpacity,Text,Image,ImageBackground, FlatList, SafeAreaView} from 'react-native'
import info from './info'
import ImageContainer from './example'


const Hotels = ()=> {
    return(
        <SafeAreaView>
        <View>
            <Text> Sandton</Text>
            <FlatList
            data={info.hotels}
            renderItem={({item})=>
                <ImageContainer key={item.id} hotels={item} />
            }
           
           keyExtractor={item=>item.id}
            />
        </View>
        <View>
            <Text> Pretoria</Text>
            <FlatList
            data={info.hotels}
            renderItem={({item})=>
                <ImageContainer key={item.id} hotels={item} />
            }
           
           keyExtractor={item=>item.id}
            />
        </View>
        </SafeAreaView>
    )
}
export default Hotels
